@Amacedorichieri No tiene con qué. Los votos son un espejismo en Argentina.
Ese país logró neutralizar a las Fuerzas Armadas en su rol de partido de gobierno, y en su lugar dejó a los sindicatos.
Ucrania es una nación milenaria. Argentina es una mezcla de pueblos y etnias diferentes, ingobernable
